import React, {useEffect, useState} from 'react';
import axios from "axios";

type CurrencyDictionary = {
    [key: string]: number
}
    
const Convert = () => {

    const [currency, setCurrency] = useState<CurrencyDictionary>()

    useEffect(() => {
        axios.get("https://api.freecurrencyapi.com/v1/latest?apikey=fca_live_5VV9AFER3RG9q1OWWk8YwSxFjzoST5KYAvmw2We3&currencies=").then((response) => {
            setCurrency(response.data);
        }).catch((error) => {
            alert(error);
        });
    });

    return <div>
        <h2>Currencies</h2>
        <table>
            <thead>
                <tr>
                    <th>Key</th>
                    <th>Code</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    {Object.keys(currency).map(v => (
                        <tr>
                            <td>{v["key"]}</td>
                        </tr>
                    ))}
                </tr>
            </tbody>
        </table>
    </div>
}
